import {mapState} from 'vuex';

export default {
    computed: {
        ...mapState({
            theme: state => state.setting.theme
        }),
        isCollapsed() {
            return this.theme.collapseSidebar;
        },
        isSideLayout() {
            return this.theme.layout === 'side';
        },
        isTopLayout() {
            return this.theme.layout === 'top';
        },
        classes() {
            return [
                `i-layout`,
                `i-layout-${this.theme.style}`,
                {
                    [`i-layout-fluid`]: this.isSideLayout,
                }
            ]
        },
        headerClasses() {
            return []
        }
    }
}
